r.x:
var $bm_rt;
var A, v;
var srcLayer = thisComp.layer('L Arm');
var srcPath = srcLayer('ADBE Root Vectors Group')(2)('ADBE Vectors Group')(1)('ADBE Vector Shape').outTangents()[0];
var target = $bm_sum(srcPath, transform.position);
var d = $bm_sub(target, transform.position);
if (d[0] == 0) {
    A = d[1] < 0 ? 90 : -90;
} else {
    A = radiansToDegrees(Math.atan($bm_div(d[1], d[0])));
}
$bm_rt = v = $bm_sum(d[0] > 0 ? A : $bm_sum(180, A), srcLayer.rotation);

